$(function () {
    let param = new URLSearchParams(window.location.search);
    let number = param.get("number");

    if (card_info.length == 0) {
        $.getJSON("../assets/json/tarot_card_reading.json", function (data) {
            card_info = data.cards;
            var this_card = card_info[number];
            $("#title").append(this_card.name);

            var html = "<img src='" + image_url_list[number] + "'><br>";
            $.each(this_card.keywords, function (i, keyword) {
                html += "<span class='keyword'>&nbsp;#" + keyword + "&nbsp;</span> ";
            });
            html += "<br><br>" + this_card.reading + "<br><br><div id='advice'>" + this_card.advice + "</div>";
            $("#reading").html(html);
        });
    }
});